import {SEARCH_PRODUCT} from "./constants";

const initialState = {
    products: []
}

export default function Reducer(state = initialState, action){
    switch(action){
        case SEARCH_PRODUCT:
            return {
                ...state,
                products: action.payload
            }
    }
}
